import '../App.css';
import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {
    return (
        <nav>
            <div className='nav-home'>
                <Link to='/'>
                    <h3 className='nav-home'>Cryptography</h3>
                </Link>
            </div>
            <div>
                <ul>
                    <Link className='nav-link' to='/shift'>
                        <li>Shift</li>
                    </Link>
                    <Link className='nav-link' to='/vigenere'>
                        <li>Vigenere</li>
                    </Link>
                    <Link className='nav-link' to='/affine'>
                        <p>Affine</p>
                    </Link>
                </ul>
            </div>

        </nav>
    );
}

export default Nav;
